import React,{FC} from 'react';
import './Button.css';

interface ButtonProps {
    children:React.ReactNode;

    
}

const Button:FC<ButtonProps> = ({children}) => {


    return (

        <button  type="submit">{children}</button>
    );
};

export default Button;
